import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import theme from './theme';

// Auth Components
import ClientLogin from './pages/auth/ClientLogin';
import ClientSignup from './pages/auth/ClientSignup';
import TechnicianLogin from './pages/auth/TechnicianLogin';
import TechnicianSignup from './pages/auth/TechnicianSignup';

// Layout Components
import Layout from './components/layout/Layout';

// Protected Route Component
import PrivateRoute from './components/auth/PrivateRoute';

// Dashboard Components
import ClientDashboard from './pages/dashboard/ClientDashboard';
import TechnicianDashboard from './pages/dashboard/TechnicianDashboard';
import AdminDashboard from './pages/dashboard/AdminDashboard';

// Ticket Components
import CreateTicket from './pages/tickets/CreateTicket';
import TicketList from './pages/tickets/TicketList';
import TicketDetails from './pages/tickets/TicketDetails';

// Admin Components
import ClientManagement from './pages/admin/ClientManagement';
import ClientTickets from './pages/admin/ClientTickets';
import TicketHistory from './pages/admin/TicketHistory';

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Routes>
        {/* Public Routes - Client access only */}
        <Route path="/" element={<Navigate to="/client/login" />} />
        <Route path="/client/login" element={<ClientLogin />} />
        <Route path="/client/signup" element={<ClientSignup />} />

        {/* Private Routes - Technician access */}
        <Route element={<PrivateRoute userType="technician" />}>
          <Route path="/technician/login" element={<TechnicianLogin />} />
          <Route path="/technician/signup" element={<TechnicianSignup />} />
        </Route>

        {/* Protected Client Routes */}
        <Route element={<PrivateRoute userType="client" />}>
          <Route element={<Layout />}>
            <Route path="/client/dashboard" element={<ClientDashboard />} />
            <Route path="/client/tickets/create" element={<CreateTicket />} />
            <Route path="/client/tickets" element={<TicketList />} />
            <Route path="/client/tickets/:id" element={<TicketDetails />} />
          </Route>
        </Route>

        {/* Protected Technician Routes */}
        <Route element={<PrivateRoute userType="technician" />}>
          <Route element={<Layout />}>
            <Route path="/technician/dashboard" element={<TechnicianDashboard />} />
            <Route path="/technician/tickets" element={<TicketList />} />
            <Route path="/technician/tickets/:id" element={<TicketDetails />} />
          </Route>
        </Route>

        {/* Protected Admin Routes */}
        <Route element={<PrivateRoute userType="admin" />}>
          <Route element={<Layout />}>
            <Route path="/admin/dashboard" element={<AdminDashboard />} />
            <Route path="/admin/clients" element={<ClientManagement />} />
            <Route path="/admin/clients/:clientId/tickets" element={<ClientTickets />} />
            <Route path="/admin/tickets/history" element={<TicketHistory />} />
            <Route path="/admin/tickets" element={<TicketList />} />
            <Route path="/admin/tickets/:id" element={<TicketDetails />} />
          </Route>
        </Route>
      </Routes>
    </ThemeProvider>
  );
}

export default App;
